import { TodoCounter } from './TodoCounter';
import{TodoSearch} from './TodoSearch';
import { TodoList } from './TodoList';
import { TodoItem } from './TodoItem';
import { CreateTodoButton } from './CreateTodoButton';
import './App.css';
import React from 'react';

const defaultTodos =[
    {text: 'Go to the gym', completed: true},
    {text: 'Make the breakfast', completed: false},
    {text: 'Start to work at home', completed: false},
    {text: 'Make Lunch', completed: false},
    {text: 'Study and learn React online', completed: false},
];

function App() {
  return (
    <React.Fragment>
      <TodoCounter 
        completed={16} total={25}
      />
      <TodoSearch />

      <TodoList>
          {defaultTodos.map( todo => (
            <TodoItem key={todo.text} />
          ))}
      </TodoList>

      <CreateTodoButton/>

    </React.Fragment>


  );
}

export default App;
